import React from "react";
import userData from "../User Data/userData";

const mack = [
  { name: "jose", status: "single", job: "software developer" },
  { name: "john", status: "single", job: "agent" },
  { name: "june", status: "married", job: "postal" },
];

const Card = () => {
  const { name, status, job } = mack;

  return (
    <div>
      <h1>{name}</h1>
      <p>{status}</p>
      <p>{job}</p>
    </div>
  );
};

export default Card;
